import React from 'react'

const BirthdayToday = ({people}) => {
    return (
        <>
          {people.map((person)=>{
              const {id,name,birthday}=person;
              return(
                  <div>
                      <span>{name}</span>
                      <span>{birthday}</span>
                  </div>
              )
          })}  
        </>
    )
}

export default BirthdayToday
